css:
.isearch.round-box {
  box-sizing: border-box;
  border-radius: 3px;
}
atom-text-editor::shadow .isearch-match .region {
  box-sizing: border-box;
  border-radius: 3px;
  background-color: transparent;
  border: 2px solid #abb2bf;
}
atom-text-editor::shadow .isearch-match.top .region {
  border: 2px solid #33a0ff;
}
atom-text-editor::shadow .isearch-match.bottom .region {
  border: 2px solid #e05252;
}
atom-text-editor::shadow .isearch-match.current .region {
  background-color: #3e4451;
}
atom-text-editor::shadow .isearch-flash .region {
  box-sizing: border-box;
  border-radius: 3px;
  background-color: #528bff;
}
atom-text-editor::shadow .isearch-cursor .region {
  background-color: #528bff;
}
atom-text-editor::shadow .isearch-hover {
  z-index: 2147483647;
  position: absolute;
  color: #d7dae0;
  background-color: #282c34;
  border-radius: 3px;
  box-shadow: 0 0 10px #abb2bf;
}
atom-text-editor::shadow .isearch-hover.top {
  background-color: #0088ff;
}
atom-text-editor::shadow .isearch-hover.bottom {
  background-color: #d92626;
}
.isearch-ui .editor-container {
  padding: 2.5px 10px;
}
.isearch-ui .counter {
  padding: 5px 10px;
  font-size: 1.3em;
  color: #9da5b4;
}
